  [],\n\t\"revision_timestamp\": \"2013-03-15T10:28:24.905605\",\n\t\"name\": \"spatial-vegetation-data-for-natural-bridges-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This polygon feature class represents vegetation
  communities mapped at Natural Bridges National Monument. The polygons were generated
  using guidelines set by the Standardized National Vegetation Classification System
  (October 1995). Original lines were drawn on a mylar overlay of printed 1:12,000
  digital scale orthophoto quadrangles (DOQ), collected the summer of 2002. Hard copy
  9X9 photography was used for photo interpretation. Traditional image interpretation
  cues were used to develop the polygons, such as shape, size, pattern, tone, texture,
  color, and shadow. Additional data layers were used in aiding the interpretation,
  such as slope, hydrology, geography, and ground-collected vegetation information.
  The lines developed in the image interpretation step were scanned using a large
  format scanner. The resultant scanned image was converted into line work for use
  within ArcGIS. The line work was cleaned, polygons created and attributed. The attributed
  vegetation classes were subjected to an accuracy assessment, following which final
  adjustments were made to the vegetation classes. As with any digital layer, this
  layer is a representation of what is actually occurring on the ground. Errors are
  inherent in any interpretation of ground qualities. Due to the \"snapshot\" nature
  of the DOQs, this vegetation layer reflects conditions that existed when the imagery
  was collected.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
